INSERT INTO `question` VALUES (1,1,1,'a','a','b','intro','2015-11-10 00:00:00',2,30),(2,1,1,'data','data','data','data','2015-11-10 00:00:00',3,30),(3,1,1,'registration','registration','registration','registration','2015-11-10 00:00:00',7,15),(7,1,1,'Aussage 1','FR00100','Gegenüber meiner Umwelt bin ich offen und kritisch.','radio','2015-10-12 00:00:00',8,15),(8,1,1,'Aussage 2','FR00200','Ich bin selten mit mir zufrieden.\r\n','radio','2015-10-13 00:00:00',9,30),(9,1,1,'Aussage 3','FR00300','Vorgegebene Regeln halte ich ganz genau ein.\r\n','radio','2015-10-13 00:00:00',10,30),(10,1,1,'Aussage 4','FR00400','Wird mir eine Sache zu kompliziert, widme ich mich etwas anderem.\r\n','radio','2015-10-13 00:00:00',11,30),(11,1,1,'Aussage 5','FR00500','Mit einer Arbeit, die ich übertragen bekomme, bin ich erst zufrieden, wenn alles gewissenhaft erledigt ist.\r\n','radio','2015-10-13 00:00:00',12,30),(12,1,1,'Aussage 6','FR00600','Manchmal lasse ich mich auch einmal gehen.','radio','2015-10-13 00:00:00',13,30),(13,1,1,'Aussage 7','FR00700','Gewisse Unsicherheiten gibt es immer im Leben. Das kann ich wegstecken.\r\n','radio','2015-10-13 00:00:00',14,30),(14,1,1,'Aussage 8','FR00800','Wer sich bemüht, kann immer etwas aus seinem Leben machen.\r\n','radio','2015-10-13 00:00:00',15,30),(15,1,1,'Aussage 9','FR00900','Ich arbeite vor allem deshalb, um mir etwas leisten zu können.\r\n','radio','2015-10-13 00:00:00',16,30),(16,1,1,'Aussage 10','FR01000','Andere holen sich bei mir Rat.','radio','2015-10-13 00:00:00',17,30),(17,1,1,'Aussage 11','FR01100','Wenn mich andere Leute unsympathisch finden, berührt mich das.\r\n','radio','2015-10-13 00:00:00',18,30),(18,1,1,'Aussage 12','FR01200','In Menschen, die ihre Arbeit so durchorganisieren, dass möglichst immer alles reibungslos verläuft, kann ich mich nur schwer hineindenken.\r\n','radio','2015-10-13 00:00:00',19,30),(19,1,1,'Aussage 13','FR01300','Mir ist es egal, was andere tun.\r\n','radio','2015-10-13 00:00:00',20,30),(20,1,1,'Aussage 14','FR01400','Ich habe Verständnis für Menschen, denen man nicht immer konsequentes Handeln nachsagt.\r\n','radio','2015-10-13 00:00:00',21,30),(21,1,1,'Aussage 15','FR01500','Ich kann sagen, dass ich Chancen immer frühzeitig erkannt habe.\r\n','radio','2015-10-13 00:00:00',22,30),(22,1,1,'Aussage 16','FR01600','Dinge und Erscheinungen meiner Umwelt beeindrucken mich stark.','radio','2015-10-23 00:00:00',23,30),(23,1,1,'Aussage 17','FR01700','Wenn ich für eine Firma (Behörde) arbeite, dann denke und handle ich an meinem Arbeitsplatz so, als ob ich selbst mit in der Unternehmensleitung sitzen würde.\r\n','radio','2015-10-23 00:00:00',24,30),(24,1,1,'Aussage 18','FR01800','Ich halte es für angemessen, dass man in seiner beruflichen Tätigkeit den nötigen Respekt der Vorgesetzten und Unterstellten verlangen sollte.\r\n','radio','2015-10-23 00:00:00',25,30),(25,1,1,'Aussage 19','FR01900','Wenn es sein muss, kann ich meine Meinung gegenüber anderen Menschen energisch durchsetzen.\r\n','radio','2015-10-23 00:00:00',26,30),(26,1,1,'Aussage 20','FR02000','Es ist das Problem der anderen, mit sich und der Welt zurechtzukommen.','radio','2015-10-23 00:00:00',27,30),(27,1,1,'Aussage 21','FR02100','Oft denke ich darüber nach, wie es zu besseren Zeiten war.','radio','2015-10-23 00:00:00',28,30),(28,1,1,'Aussage 22','FR02200','Ich kann sehr plötzlich reagieren.','radio','2015-10-23 00:00:00',29,30),(29,1,1,'Aussage 23','FR02300','Eine Aufgabe ist für mich dann gelöst, wenn das Ergebnis jeder Prüfung standhält.','radio','2015-10-23 00:00:00',30,30),(30,1,1,'Aussage 24','FR02400','Mir ist es lieber, wenn ich im \'stillen Kämmerlein\' arbeiten kann.','radio','2015-10-23 00:00:00',31,30),(31,1,1,'Aussage 25','FR02500','Manchmal habe ich ganz verrückte Einfälle.\r\n','radio','2015-10-23 00:00:00',32,30),(32,1,1,'Aussage 26','FR02600','Jeder hat seine Rechte. Ich achte darauf, dass ein 8-Stunden-Arbeitstag bei mir auch nicht mehr als 8 Stunden dauert.','radio','2015-10-23 00:00:00',33,30),(33,1,1,'Aussage 27','FR02700','Ich bin gegenüber anderen Menschen meist mitfühlend.\r\n','radio','2015-10-23 00:00:00',34,30),(34,1,1,'Aussage 28','FR02800','Ich habe in meinem Leben schon genug Probleme gelöst, jetzt sollen sich die anderen die Finger verbrennen.','radio','2015-10-23 00:00:00',35,30),(35,1,1,'Aussage 29','FR02900','Ich schmiede gern Pläne.','radio','2015-10-23 00:00:00',36,30),(36,1,1,'Aussage 30','FR03000','In dieser hektischen Zeit kommt es vor, dass man hin und wieder etwas vergisst.\r\n','radio','2015-10-23 00:00:00',37,30),(37,1,1,'Feedback 1','Feedback 1','Antworten Sie noch oder manipulieren Sie sich schon?','feedback','2015-10-23 00:00:00',38,5),(38,1,1,'Feedback 2','Feedback 2','Sie haben Ihren Arbeitsrhythmus gefunden! Weiter so!','feedback','2015-10-23 00:00:00',42,5),(42,1,1,'Aussage 31','FR03100','Ich bin bestrebt, mir eine Position und damit verbundene Rechte zu erarbeiten.','radio','2015-11-12 00:00:00',44,30),(44,1,1,'Frage 32','FR03200','Wie viele Würfel sehen Sie insgesamt aus den verschiedenen Blickwinkeln?','slider','2015-11-12 00:00:00',45,60),(45,1,1,'Aussage 33','FR03300','Meinungsstreit und Spannungen rufen bei mir ein angenehmes Kribbeln im Bauch hervor.','radio','2015-11-12 00:00:00',46,30),(46,1,1,'Aussage 34','FR03400','Mit nur einer Lösung gebe ich mich selten zufrieden.','radio','2015-11-12 00:00:00',47,30),(47,1,1,'Aussage 35','FR03500','Es gibt Leute, die ich regelrecht hasse.','radio','2015-11-12 00:00:00',48,30),(48,1,1,'Aussage 36','FR03600','Ich handle nicht selten schnell \'aus dem Bauch heraus\'.','radio','2015-11-12 00:00:00',49,30),(49,1,1,'Aussage 37','FR03700','Wenn ich Missstände entdecke, fühle ich mich verpflichtet, etwas dagegen zu tun.','radio','2015-11-12 00:00:00',50,30),(50,1,1,'Aussage 38','FR03800','Ich werde von anderen anerkannt.','radio','2015-11-12 00:00:00',51,30),(51,1,1,'Aussage 39','FR03900','Es fällt mir schwer, immer pünktlich zu sein.','radio','2015-11-12 00:00:00',52,30),(52,1,1,'Aussage 40','FR04000','Alles Neue und sogenannte \'Originelle\' betrachte ich mit Skepsis.','radio','2015-11-12 00:00:00',53,30),(53,1,1,'Aussage 41','FR04100','Wenn ich mich auf eine Sache konzentriere, kann mich nichts davon ablenken.','radio','2015-11-12 00:00:00',54,30),(54,1,1,'Aussage 42','FR04200','Ich bin ein gründlicher Mensch.','radio','2015-11-12 00:00:00',55,30),(55,1,1,'Aussage 43','FR04300','Die Feststellung: \'Die Arbeit muss dem Menschen die Chance eröffnen, Ansehen zu erreichen\', halte ich prinzipiell für wichtig.','radio','2015-11-12 00:00:00',56,30),(56,1,1,'Aussage 44','FR04400','Ich bin ein entscheidungsfreudiger Mensch.','radio','2015-11-12 00:00:00',57,30),(57,1,1,'Aussage 45','FR04500','Manches tue ich einfach aus einer Eingebung heraus.','radio','2015-11-12 00:00:00',58,30),(58,1,1,'Aussage 46','FR04600','Ich liebe es, ausdauernd an einer Lösung zu arbeiten.','radio','2015-11-12 00:00:00',59,30),(59,1,1,'Aussage 47','FR04700','Ich fühle mich am wohlsten, wenn ich die aus meiner Arbeit resultierenden Aufgaben nach besten Kräften lösen kann. Alles andere (Familie, Hobby usw.) ordnet sich diesem Ziel unter.','radio','2015-11-12 00:00:00',60,30),(60,1,1,'Aussage 48','FR04800','Ich glaube, dass man die Zusammenarbeit mit anderen Menschen während seiner Arbeitszeit braucht.','radio','2015-11-12 00:00:00',61,30),(61,1,1,'Aussage 49','FR04900','Es gibt Situationen, in denen kann man echt verzweifeln.','radio','2015-11-12 00:00:00',62,30),(62,1,1,'Frage 50','FR05000','Welche der Abbildungen 1 bis 4 gehört in das Feld mit dem Fragezeichen?','radio','2015-11-12 00:00:00',63,120),(63,1,1,'Aussage 51','FR05100','Die Arbeit dient in erster Linie dazu, Geld zu verdienen.','radio','2015-11-12 00:00:00',64,30),(64,1,1,'Aussage 52','FR05200','Wenn ich mich mit einer Sache beschäftige, fühle ich mich auch voll und ganz dafür verantwortlich.','radio','2015-11-12 00:00:00',65,30),(65,1,1,'Aussage 53','FR05300','In kritischen Situationen steigern sich meine Leistungen.','radio','2015-11-12 00:00:00',66,30),(66,1,1,'Aussage 54','FR05400','Ich kann mich jederzeit beherrschen.','radio','2015-11-12 00:00:00',67,30),(67,1,1,'Aussage 55','FR05500','Eine Sache, die ich begonnen habe, bringe ich auch zu Ende.','radio','2015-11-12 00:00:00',68,30),(68,1,1,'Aussage 56','FR05600','Ich halte es persönlich für wichtig zu arbeiten, um Ergebnisse zu erzielen. Zwischenmenschliche Beziehungen während der Arbeit sind für mich dafür Mittel zum Zweck.','radio','2015-11-12 00:00:00',69,30),(69,1,1,'Aussage 57','FR05700','Ich träume gern, wie sich etwas realisieren ließe.','radio','2015-11-12 00:00:00',70,30),(70,1,1,'Aussage 58','FR05800','Ich kontrolliere meine Arbeit, um ein hochwertiges Ergebnis zu erzielen.','radio','2015-11-12 00:00:00',71,30),(71,1,1,'Aussage 59','FR05900','Ich muss etwas bewegen, sonst werde ich krank.','radio','2015-11-12 00:00:00',72,30),(72,1,1,'Aussage 60','FR06000','Es ist anstrengend, immer das Wesentliche von Dingen und Erscheinungen zu erkennen.','radio','2015-11-12 00:00:00',73,30),(73,1,1,'Feedback 3','Feedback 3','Ein Fragebogen ist immer ein geeignetes Mittel zu versuchen, sich selbst oder anderen etwas vorzumachen. Dieser Fragebogen berücksichtigt das!','feedback','2015-11-12 00:00:00',74,5),(74,1,1,'Feedback 4','Feedback 4','Sie beantworten die Fragen zügig und konzentriert. Danke! Die Hälfte der Fragen ist geschafft. Bleiben Sie auch weiter aufmerksam bei der Sache!','feedback','2015-11-12 00:00:00',75,5),(75,1,1,'Aussage 61','FR06100','Ich habe es im Leben meist schwerer gehabt als andere.','radio','2015-11-12 00:00:00',76,30),(76,1,1,'Aussage 62','FR06200','Mir macht es nichts aus, im Leben hin und wieder auch einmal Risiken einzugehen.','radio','2015-11-12 00:00:00',77,30),(77,1,1,'Aussage 63','FR06300','Ich komme mit anderen Menschen gut zurecht.','radio','2015-11-12 00:00:00',78,30),(78,1,1,'Aussage 64','FR06400','Je ungewöhnlicher eine Situation ist, desto besser.','radio','2015-11-12 00:00:00',79,30),(79,1,1,'Aussage 65','FR06500','Wenn man sich nicht um alles selbst kümmert, funktioniert nichts.','radio','2015-11-12 00:00:00',80,30),(80,1,1,'Aussage 66','FR06600','Wenn ich arbeite, will ich vor allem Geld verdienen. Alles andere ordnet sich dem unter.','radio','2015-11-12 00:00:00',81,30),(81,1,1,'Aussage 67','FR06700','Ein Einzelarbeitsplatz, an dem ich nichts mit anderen Menschen zu tun habe, ist nicht meine Welt.','radio','2015-11-12 00:00:00',82,30),(82,1,1,'Aussage 68','FR06800','Ich kann andere Menschen emotional bewegen.','radio','2015-11-12 00:00:00',83,30),(83,1,1,'Aussage 69','FR06900','Wenn ich eine bessere Lösung habe, setze ich alles daran, vorgegebene Handlungsvorschriften umzustoßen.','radio','2015-11-12 00:00:00',84,30),(84,1,1,'Aussage 70','FR07000','Es macht mir nichts aus, jemanden um etwas zu bitten.','radio','2015-11-12 00:00:00',85,30),(85,1,1,'Aussage 71','FR07100','Was ich sage, wird auch gemacht.','radio','2015-11-12 00:00:00',86,30),(86,1,1,'Aussage 72','FR07200','Mich bringt so schnell nichts aus der Ruhe.','radio','2015-11-12 00:00:00',87,30),(87,1,1,'Frage 73','FR07300','Welches der Bilder gibt am besten Ihren üblichen Tagesablauf wieder? Bild Nr. 1, Bild Nr. 2 oder Bild Nr. 3.','img','2015-11-12 00:00:00',88,30),(88,1,1,'Aussage 74','FR07400','Wenn sich eine Situation geändert hat, kann ich mich schnell darauf einstellen.','radio','2015-11-12 00:00:00',89,30),(89,1,1,'Aussage 75','FR07500','Ich arbeite genau so präzise, wie ich dafür bezahlt werde.','radio','2015-11-12 00:00:00',90,30),(90,1,1,'Aussage 76','FR07600','Das Berufsfeld ist ein entscheidender Lebensbereich, um mit anderen Menschen zusammenarbeiten zu können.','radio','2015-11-12 00:00:00',91,30),(91,1,1,'Aussage 77','FR07700','Mich stört es wenig, dass nichts im Leben Bestand hat.','radio','2015-11-12 00:00:00',92,30),(92,1,1,'Aussage 78','FR07800','In Bewährungssituationen kann man sehr leicht versagen.','radio','2015-11-12 00:00:00',93,30),(93,1,1,'Aussage 79','FR07900','Ich trete gern mit anderen in Erfahrungsaustausch.','radio','2015-11-12 00:00:00',94,30),(94,1,1,'Aussage 80','FR08000','Ich habe oft Ideen, weiß aber nicht, wie ich sie realisieren soll.','radio','2015-11-12 00:00:00',95,30),(95,1,1,'Aussage 81','FR08100','Mit mir kann man Bäume ausreißen.','radio','2015-11-12 00:00:00',96,30),(96,1,1,'Aussage 82','FR08200','Es fällt mir schwer, nein zu sagen.','radio','2015-11-12 00:00:00',97,30),(97,1,1,'Aussage 83','FR08300','Konventionelle oder traditionelle Anschauungen sind für die Lebensgestaltung wichtig.','radio','2015-11-12 00:00:00',98,30),(98,1,1,'Aussage 84','FR08400','Ich bin ein vorsichtiger Mensch und habe gelernt, genau nach mir vorgegebenen Anweisungen zu handeln.','radio','2015-11-12 00:00:00',99,30),(99,1,1,'Aussage 85','FR08500','Vorschläge sind vor allem dazu da, kritisch geprüft zu werden.','radio','2015-11-12 00:00:00',100,30),(100,1,1,'Aussage 86','FR08600','Es fällt mir leicht, Bekanntschaften zu schließen.','radio','2015-11-12 00:00:00',101,30),(101,1,1,'Aussage 87','FR08700','Der Mensch sollte mit dem, was er erreicht hat, prinzipiell zufrieden sein.','radio','2015-11-12 00:00:00',102,30),(102,1,1,'Aussage 88','FR08800','Es ist nicht in jedem Fall angebracht, einmal Versprochenes auch zu halten.','radio','2015-11-12 00:00:00',103,30),(103,1,1,'Aussage 89','FR08900','Irgendwie fühle ich mich oft erschöpft und abgespannt.','radio','2015-11-12 00:00:00',104,30),(104,1,1,'Aussage 90','FR09000','Ich kann andere Menschen dazu bringen, in einer bestimmten Weise aktiv zu werden.','radio','2015-11-12 00:00:00',105,30),(105,1,1,'Aussage 91','FR09100','Ich lasse es selten zum Streit kommen. \'Der Klügere gibt nach.\'','radio','2015-11-12 00:00:00',106,30),(106,1,1,'Feedback 5','Feedback 5','Nicht nachdenken! Antworten!','feedback','2015-11-12 00:00:00',107,5),(107,1,1,'Feedback 6','Feedback 6','Sie konzentrieren sich gut!','feedback','2015-11-12 00:00:00',108,5),(108,1,1,'Aussage 92 (1)','FR09201','Management - Stellen Sie sich vor, diese \'Menschen\' wären Ihre Firma. Welche Firmenabteilung würden Sie welchem Körperteil zuordnen?','select','2015-11-16 19:43:43',109,20),(109,1,1,'Aussage 92 (2)','FR09202','Controlling - Stellen Sie sich vor, diese \'Menschen\' wären Ihre Firma. Welche Firmenabteilung würden Sie welchem Körperteil zuordnen?','select','2015-11-16 19:43:43',110,20),(110,1,1,'Aussage 92 (3)','FR09203','Public Relations - Stellen Sie sich vor, diese \'Menschen\' wären Ihre Firma. Welche Firmenabteilung würden Sie welchem Körperteil zuordnen?','select','2015-11-16 19:43:43',111,20),(111,1,1,'Aussage 92 (4)','FR09204','Marketing - Stellen Sie sich vor, diese \'Menschen\' wären Ihre Firma. Welche Firmenabteilung würden Sie welchem Körperteil zuordnen?','select','2015-11-16 19:43:43',112,20),(112,1,1,'Aussage 92 (5)','FR09205','Produktion - Stellen Sie sich vor, diese \'Menschen\' wären Ihre Firma. Welche Firmenabteilung würden Sie welchem Körperteil zuordnen?','select','2015-11-16 19:43:43',113,20),(113,1,1,'Aussage 92 (6)','FR09206','Fuhrpark - Stellen Sie sich vor, diese \'Menschen\' wären Ihre Firma. Welche Firmenabteilung würden Sie welchem Körperteil zuordnen?','select','2015-11-16 19:43:43',114,20),(114,1,1,'Aussage 93','FR09300','Andere Menschen vertrauen mir.','radio','2015-11-16 19:59:00',115,30),(115,1,1,'Aussage 94','FR09400','Irgendwie fühle ich mich immer einsam, egal wo ich bin und was ich mache.','radio','2015-11-16 19:59:00',116,30),(116,1,1,'Aussage 95','FR09500','Ich fühle mich wohl, wenn ich meine Leistung mit der anderer vergleichen kann.','radio','2015-11-16 19:59:00',117,30),(117,1,1,'Aussage 96','FR09600','Meinen Argumenten kann man sich selten entziehen.','radio','2015-11-16 19:59:00',118,30),(118,1,1,'Aussage 97','FR09700','Ich bin mehr ein schweigsamer Typ.','radio','2015-11-16 19:59:00',119,30),(119,1,1,'Aussage 98','FR09800','Wenn ich Erfolg habe, bin ich vor Freude kaum zu halten.','radio','2015-11-16 19:59:00',120,30),(120,1,1,'Aussage 99','FR09900','Wenn mir etwas gegen den Strich geht, kann ich richtig wütend werden.','radio','2015-11-16 19:59:00',121,30),(121,1,1,'Aussage 100','FR10000','Ich habe mich schon des Öfteren dabei ertappt, wie ich im Affekt gehandelt habe.','radio','2015-11-16 19:59:00',122,30),(122,1,1,'Aussage 101','FR10100','Ständig etwas Neues macht mich nervös.','radio','2015-11-16 19:59:00',123,30),(123,1,1,'Aussage 102','FR10200','Ich teile die Auffassung: \'Im Allgemeinen ist eine Arbeit nur dann sinnvoll, wenn klare Ergebnisse erzielt werden.\'','radio','2015-11-16 19:59:00',124,30),(124,1,1,'Aussage 103','FR10300','Kritik regt mich auf.','radio','2015-11-16 19:59:00',125,30),(125,1,1,'Aussage 104','FR10400','Konflikte machen mich nicht heiß.','radio','2015-11-16 19:59:00',126,30),(126,1,1,'Aussage 105','FR10500','Ich kann nicht anders, ich muss alles genau machen.','radio','2015-11-16 19:59:00',127,30),(127,1,1,'Aussage 106','FR10600','Gefühle kann ich gut unterdrücken.','radio','2015-11-16 19:59:00',128,30),(128,1,1,'Aussage 107','FR10700','Ein Ziel verfolge ich so lange, bis ich es erreicht habe.','radio','2015-11-16 19:59:00',129,30),(129,1,1,'Aussage 108','FR10800','Ich mag Teamwork.','radio','2015-11-16 19:59:00',130,30),(130,1,1,'Aussage 109','FR10900','Es beschäftigt mich schon längere Zeit, wenn jemand mein Verhalten beanstandet.','radio','2015-11-16 19:59:00',131,30),(131,1,1,'Aussage 110','FR11000','Es gibt immer einen Weg, weiter voranzukommen.','radio','2015-11-16 19:59:00',132,30),(132,1,1,'Aussage 111','FR11100','Wenn ich ein Problem erkenne, muss ich handeln, um es zu lösen.','radio','2015-11-16 19:59:00',133,30),(133,1,1,'Aussage 112','FR11200','Ich bin oft in eine Position gewählt worden, um im Auftrag einer Gruppe für deren Belange einzutreten.','radio','2015-11-16 19:59:00',134,30),(134,1,1,'Aussage 113','FR11300','Ich grüble oft über mich nach.','radio','2015-11-16 19:59:00',135,30),(135,1,1,'Aussage 114','FR11400','In meinem Leben hat sich in letzter Zeit etwas radikal verändert.','radio','2015-11-16 19:59:00',136,30),(136,1,1,'Aussage 115','FR11500','Im Großen und Ganzen bin ich mit mir zufrieden.','radio','2015-11-16 19:59:00',137,30),(137,1,1,'Aussage 116','FR11600','B','groupFix','2015-11-17 00:00:00',138,50),(138,1,1,'Feedback 9','Feedback 9','Sind Sie nervös? Können Sie sich nur schwer konzentrieren oder zu gar keiner Antwort entschließen? Bleiben Sie cool! Es nützt Ihnen!','feedback','2015-11-17 00:00:00',139,5),(139,1,1,'Feedback 10','Feedback 10','Sie beantworten die Fragen wirklich gut! Gratulation! Dafür werden Sie mit einem ehrlichen Abbild Ihrer Persönlichkeitsstruktur belohnt!','feedback','2015-11-17 00:00:00',140,5),(140,1,1,'Aussage 117','FR11700','In welcher Branche/in welchem Berufsfeld würden Sie gern tätig sein? Lesen Sie sich die folgende Liste durch und markieren Sie bitte eine von Ihnen bevorzugte Branche.','select','2015-11-17 00:00:00',141,20),(141,1,1,'Aussage 118','FR11800','Ausgehend von Ihrem derzeitigen Wissen und Können, welche wäre Ihre Wunschposition in der von Ihnen gewählten Branche? Wählen Sie bitte eine Position aus.','select','2015-11-17 00:00:00',142,20),(142,1,1,'Aussage 119','FR11900','In welchem Tätigkeitsverhältnis befinden Sie sich zurzeit?','select','2015-11-17 00:00:00',143,20),(143,1,1,'Aussage 120','ZB00100','Ich bin familiär beziehungsweise durch meinen Freund (meine Freundin) an meinen jetzigen Wohnort für längere Zeit gebunden.','radio','2015-11-19 20:17:21',144,30),(144,1,1,'Aussage 121','ZB00200','Eine längere Anreise von bis zu zwei Stunden zu einem künftigen Arbeitsort ist für mich durchaus akzeptabel.','radio','2015-11-19 20:17:21',145,30),(145,1,1,'Aussage 122','ZB00300','Es wäre mir möglich umzuziehen, wenn ich dadurch eine gute Arbeit bekäme.','radio','2015-11-19 20:17:21',146,30),(146,1,1,'Aussage 123','ZB00400','Würden Sie Ihr Privatfahrzeug auch während der Arbeit zur Erledigung bestimmter dienstlicher Aufgaben einsetzen?','radio','2015-11-19 20:17:21',171,30),(147,1,1,'Aussage 120','ZB00100','Ich bin familiär beziehungsweise durch meinen Freund (meine Freundin) an meinen jetzigen Wohnort für längere Zeit gebunden.','radio','2015-11-19 20:22:29',148,30),(148,1,1,'Aussage 121','ZB00200','Eine längere Anreise von bis zu zwei Stunden zu einem künftigen Arbeitsort ist für mich durchaus akzeptabel.','radio','2015-11-19 20:22:29',149,30),(149,1,1,'Aussage 122','ZB00300','Es wäre mir möglich umzuziehen, wenn ich dadurch eine gute Arbeit bekäme.','radio','2015-11-19 20:22:29',150,30),(150,1,1,'Aussage 123','ZB00400','Würden Sie Ihr Privatfahrzeug auch während der Arbeit zur Erledigung bestimmter dienstlicher Aufgaben einsetzen?','radio','2015-11-19 20:22:29',151,30),(151,1,1,'Aussage 124','ZB00501','Wie oft haben Sie sich in den letzten 12 Monaten durch versenden der Bewerbungsunterlagen per Post, Fax oder E-Mail beworben?','select','2015-11-19 20:27:23',152,10),(152,1,1,'Aussage 125','ZB00502','Wie oft haben Sie sich in den letzten 12 Monaten durch versenden der Bewerbungsunterlagen durch Telefongespräche beworben?','select','2015-11-19 20:27:23',153,10),(153,1,1,'Aussage 126','ZB00503','Wie oft haben Sie sich in den letzten 12 Monaten durch versenden der Bewerbungsunterlagen persönliche Vorstellungsgespräche beworben?','select','2015-11-19 20:27:23',154,10),(154,1,1,'Aussage 127','ZB00600','Ich möchte so viel wie möglich lernen, um mich für neue Berufsfelder fit zu machen.','radio','2015-11-19 20:44:52',155,30),(155,1,1,'Aussage 128','ZB00700','Zu meiner beruflichen Entwicklung berate ich mich in jedem Fall mit Freunden und Bekannten.','radio','2015-11-19 20:44:52',156,30),(156,1,1,'Aussage 129','ZB00800','Ich habe keine Kraft mehr, mich Bildungsdruck auszusetzen.','radio','2015-11-19 20:44:52',157,30),(157,1,1,'Aussage 130','ZB00900','Eine Arbeit muss mindestens so viel Einkommen erbringen, wie die mir zustehende derzeitige finanzielle Unterstützung durch staatliche Institutionen. Alles andere ergibt keinen Sinn.','radio','2015-11-19 20:44:52',158,30),(158,1,1,'Aussage 131','ZB01000','Bildungsangebote erwarte ich vorrangig von den Institutionen der Arbeits- und Sozialversicherung.','radio','2015-11-19 20:44:52',159,30),(159,1,1,'Aussage 132','ZB01100','Man kann in der Erwachsenenbildung nicht noch Selbststudium nach der Unterrichtszeit verlangen.','radio','2015-11-19 20:44:52',160,30),(160,1,1,'Aussage 133','ZB01200','Es ist nicht ratsam, jede Arbeit anzunehmen - auch wenn sie seriös ist. Ein gewisser Anspruch sollte schon gewahrt bleiben.','radio','2015-11-19 20:44:52',161,30),(161,1,1,'Aussage 134','ZB01300','Bei den gegenwärtigen Arbeitsangeboten ist es für mich nicht möglich, ein konkretes Ziel zu bestimmen.','radio','2015-11-19 20:44:52',162,30),(162,1,1,'Aussage 135','ZB01400','Ich möchte während einer Qualifizierung klar erfahren, was ich kann und wie ich mich noch verbessern könnte.','radio','2015-11-19 20:44:52',163,30),(163,1,1,'Aussage 136','ZB01500','Hauptsache ist für mich, zu arbeiten. Alles andere wird sich finden.','radio','2015-11-19 20:44:52',164,30),(164,1,1,'Aussage 137','ZB01600','Ich bin ein Mensch der Kontinuität und kann nicht heute das und morgen wieder etwas völlig anderes lernen.','radio','2015-11-19 20:44:52',165,30),(165,1,1,'Aussage 138','ZB01700','Ich bin ein \'Kind von schnellen Entschlüssen\'.','radio','2015-11-19 20:44:52',166,30),(166,1,1,'Aussage 139','ZB01800','Die Arbeitsmarktsituation ist für mich frustrierend. Mich begleiten Ängste und Nöte, die mich sehr vorsichtig machen, Entschlüsse zu fassen.','radio','2015-11-19 20:44:52',167,30),(167,1,1,'Aussage 140','ZB01900','Noten und immanente Leistungseinschätzungen während einer Erwachsenenbildungsmaßnahme halte ich für unangebracht.','radio','2015-11-19 20:44:52',168,30),(168,1,1,'Aussage 141','ZB02000','Ich habe einen klaren Plan, wie ich meine neue Berufstätigkeit anstrebe.','radio','2015-11-19 20:44:52',169,30),(169,1,1,'Aussage 142','ZB02100','Ich brauche jemanden, der mich antreibt, um Wege auf neuen Arbeitsfeldern zu gehen.','radio','2015-11-19 20:44:52',170,30),(170,1,1,'Aussage 143','ZB02200','Ich weiß genau, welche Qualifikationen ich benötige, und versuche, entsprechende Kurse zu belegen.','radio','2015-11-19 20:44:52',171,30),(171,1,1,'Feedback xy','Feedback xy','Sie haben es gleich geschafft! Bitte beantworten Sie uns zum Schluss noch folgende Fragen!','feedback','2015-11-20 00:00:00',172,5),(172,1,1,'Frage 1','FR12300','Wie leicht fiel Ihnen die Beantwortung der Fragen?','input','2015-11-19 20:55:16',173,10),(173,1,1,'Frage 2','FR12400','Wie gern haben Sie die Befragung durchgeführt?','input','2015-11-19 20:55:16',174,30),(174,1,1,'Frage 3(1)','FR12501','Unter welchen Bedingungen fand die Befragung statt?','select','2015-11-19 20:55:16',175,10),(175,1,1,'Frage 3(2)','FR12502','Unter welchen Bedingungen fand die Befragung statt?','select','2015-11-19 20:55:16',176,10),(176,1,1,'Frage 3(3)','FR12503','Unter welchen Bedingungen fand die Befragung statt?','select','2015-11-19 20:55:16',177,10),(177,1,1,'Frage 4','FR12600','Alle Fragen beantwortete ich freiwillig am:','input','2015-11-19 20:55:16',178,30),(178,1,1,'Frage 5','FR12700','Die Befragung fand statt in:','input','2015-11-19 20:55:16',179,30),(179,1,1,'Done','Done','finished','finished','2015-11-19 20:55:16',1,30);
